// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";

contract AccessControl {

    using Counters for Counters.Counter;
    Counters.Counter private _counter;

    address public owner;

    enum Status {
        PendingApproval,
        Approved,
        Rejected,
        Revoked
    }

    enum Type {
        BusinessLicense,
        InsuranceCertificate,
        TrainingCertificate,
        ProjectDocument    
    }

    struct Contractor {
        address contractor;
        string name;
        Status status;
    }

    struct Document {
        uint documentId;
        string link;
        uint expirationDate;
        Status status;
        Type documentType;
        address uploadedBy;
        string rejectReason;
    }

    mapping(address => Contractor) public contractors;
    mapping(uint => Document) public documents;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can access this function.");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    event ContractorAdded(address indexed contractor, string name);
    event ContractorApproved(address indexed contractor);
    event ContractorRejected(address indexed contractor);
    event ContractorRevoked(address indexed contractor);
    event ContractorStatusChange(address indexed contractor, Status status);
    event DocumentUploaded(address indexed contractor, uint256 documentId, string link, uint256 expirationDate, Status status, Type documentType);
    event DocumentApproved(address indexed contractor, uint256 documentId);
    event DocumentRejected(address indexed contractor, uint256 documentId, string rejectReason);
    event DocumentRevoked(address indexed contractor, uint256 documentId);


    function isContractor(address contractor) private view returns(bool){
        return contractors[contractor].contractor != address(0);
    }

    function getContractor(address contractor) external view returns(Contractor memory){
        require(isContractor(contractor), "Contractor does not exist");
        return contractors[contractor];
    }

    function changeContractorStatus(address contractor, Status status) internal onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        contractors[contractor].status == status;

        emit ContractorStatusChange(contractors[contractor].contractor, contractors[contractor].status);
    }

    function getContractorStatus(address contractor) private view returns (Status) {
        require(isContractor(contractor), "Contractor does not exist");
        return contractors[contractor].status;
    }

    function addContractor(string calldata name) external {
        require(!isContractor(msg.sender), "Contractor already exists");
        contractors[msg.sender] = Contractor(msg.sender, name, Status.PendingApproval);

        emit ContractorAdded(msg.sender, contractors[msg.sender].name);
    }

    function approveContractor(address contractor) internal onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        require(getContractorStatus(contractor) == Status.PendingApproval, "Contractor is not pending approval");

        changeContractorStatus(contractor, Status.Approved);

        emit ContractorApproved(contractors[contractor].contractor);
    }

    function rejectContractor(address contractor) external onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        require(getContractorStatus(contractor) == Status.PendingApproval);

        contractors[contractor].status == Status.Rejected;

        emit ContractorRejected(contractor);
    }

    function revokeContractor(address contractor) external onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        require(getContractorStatus(contractor) == Status.Approved);

        contractors[contractor].status == Status.Revoked;

        emit ContractorRevoked(contractor);
    }

    function isContractorApproved(address contractor) private view returns(bool){
        return getContractorStatus(contractor) == Status.Approved;
    } 

    function uploadDocument(string calldata link, uint expirationDate, Type documentType) external {
        require(isContractor(msg.sender), "Contractor does not exist");
        require(isContractorApproved(msg.sender), "Contractor must be approved first");

        _counter.increment();
        uint256 documentId = _counter.current();

        documents[documentId] = Document(
            documentId,
            link,
            expirationDate,
            Status.PendingApproval,
            documentType,
            msg.sender,
            "" // Empty rejectReason
        );
    }

    function approveDocument(address contractor, uint documentId) external onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        require(documents[documentId].status == Status.PendingApproval, "Document is not pending approval");

        documents[documentId].status = Status.Approved;

        emit DocumentApproved(contractor, documentId);
    }

    function rejectDocument(address contractor, uint documentId, string memory rejectReason) external onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        require(documents[documentId].status == Status.PendingApproval, "Document is not pending approval");

        documents[documentId].status = Status.Rejected;
        documents[documentId].rejectReason = rejectReason;

        emit DocumentRejected(contractor, documentId, rejectReason);
    }

    function revokeDocument(address contractor, uint documentId) external onlyOwner {
        require(isContractor(contractor), "Contractor does not exist");
        require(documents[documentId].status == Status.Approved, "Document is not approved");

        documents[documentId].status = Status.Revoked;

        emit DocumentRevoked(contractor, documentId);
    }


}
